import styled from "styled-components";

const Container = styled.div``;
const Wrapper = styled.div``;
const Title = styled.h1``;


const Register = () => {
  return (
    <Container>
        <Wrapper>
            <Title>CREATE ACCOUNT</Title>
        </Wrapper>
    </Container>
  )
}

export default Register
